package com.tcr.springbootpoi.service;import com.tcr.springbootpoi.common.utils.excelexp.bean.ExcelHeader;import java.io.OutputStream;import java.util.List;public interface IExport<T> {    /***     * 获取title     * @return     */    public String getTitle();    /***     * 获取头部信息     * @return     */    public List<ExcelHeader> getHeader();    /***     * 需要导出的数据     * @return     */    public List<T> getData();    /**     * 需要输出的流 可以返回null     * @return     */    public OutputStream getOutputStream();    /**     * 导出的文件路径     * @return     */    public String getFilePath();}